            .then((res) => {
                console.log(res.data);
                setFromDb(res.data);
            })
            .catch((err) => console.log(err));
        // .catch((err) => console.log(err.response.data.err.errors));

        setLoaded(false);
    }, []);

    return (
        <>
            <h1>TEST HOME</h1>
            {fromDb.map((item, i) => {
                return <p key={i}>{item.username} {item.password}</p>;
            })}
        </>
    );
};

export default Home;
